import React from 'react';
import './styles/App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import Navbar from './components/NavBar';
import MainContent from './components/MainContent';

const App: React.FC = () => {
  return (
    <div className="App">
      <Header />
      <Navbar />
      <MainContent />
      <Footer />
    </div>
  );
};

export default App;
